import React,{useState,useEffect} from 'react'

function Weather() {
    const [city,setCity] = useState('Singapore')
    return (
        <div>
            <h1>Open Weather</h1>
            <input type="text"
            value={city}
            onChange={e=>setCity(e.target.value)}
            />
            <h2>{city}</h2>
        </div>
    )
}

export default Weather
